import React, { Component } from 'react';
import OneTop from './OneTop.js';

const Top = (props) => {
    const todos = props.tasks.map((todo, index) => {
      return <OneTop content={todo} key={index} id={index} />
    })
    return( 
      <div className='list-wrapper'>
        {todos}
      </div>
    );
  }

  export default Top;
